import React from "react";

function Table(props){
    let thub = props.thumbnail
    let source = "/imag/" + thub
    return (
        <tr id={props.ID} className="border-bottom ">
            <td className="{props.ID}" >{props.ID}</td> 
            <td><img src={source} alt=""/></td>
            <td className="FirstName" onDoubleClick={props.update(this, 'FirstName', '{props.ID}', '{props.FirstName}')}>{props.FirstName }</td>
            <td className="LastName" onDoubleClick={props.update(this, 'LastName', '{props.ID}', '{props.LastName}')}>{props.LastName }</td>
            <td className="height" onDoubleClick={props.update(this, 'height', '{props.ID}', '{props.height}')}>{props.height}</td>

            <td>
                {/* <button className="btn btn-outline-danger" onClick={props.deleteMe({props.ID})} >ðŸ—‘</button> */}
            </td>
        </tr>
    )
}

export default Table;
